INSERT INTO `peliculas` (`id`, `popularity`, `title`, `overview`, `releasedate`, `image`, `genre_ids`) VALUES
(531219, '1497.123', 'Las brujas', 'Cuenta la conmovedora historia de un pequeño huérfano que, a finales de 1967, se va a vivir con su querida abuela a Demopolis, un pueblo de Alabama. El niño y su abuela tienen extraños encuentros con algunas brujas aparentemente glamurosas pero absolutamente diabólicas, así que ella decide quitarse de en medio y llevarse al chico a un hotel de lujo en la costa. Por desgracia, llegan exactamente al mismo tiempo que la Gran Bruja que ha reunido a sus compinches de todo el planeta -que van de incóg', '2020-10-26', '/a5mJNwkAR24Jfs8ft2NmxkiGRN2.jpg', '14,10751,12,35,27'),
(400160, '1743.741', 'Bob Esponja: Un héroe al rescate', 'Los amigos son lo más importante para Bob Esponja, por lo que no dudará en salir de la comodidad de su hogar en Fondo de Bikini, junto con Patricio, para adentrarse en un mundo desconocido, arriesgando sus vidas, para salvar a su amigo de la infancia, Gary, de las garras del rey Poseidón que le ha secuestrado en la Ciudad Perdida de la Atlantida. ¿Serán capaces de lograrlo?', '2020-08-14', '/jcJpkQWRU8gsZlo830eQ8ryXKNU.jpg', '14,16,12,35,10751'),
(671039, '2139.868', 'Bronx', 'Un policía leal, en el punto de mira de agentes corruptos y de belicosas bandas de Marsella, debe proteger a su brigada. Y se ocupará personalmente de la situación.', '2020-10-30', '/hSpm2mMbkd0hLTRWBz0zolnLAyK.jpg', '53,28,18,80'),
(724989, '1821.631', 'Mercenarios de élite', 'El trabajo del multimillonario CEO de tecnología Donovan Chalmers es tan valioso que contrata mercenarios para protegerlo, y un grupo terrorista secuestra a su hija solo para conseguirlo.', '2020-10-23', '/ugZW8ocsrfgI95pnQ7wrmKDxIe.jpg', '28,53'),
(528085, '1514.38', '2067', 'El viaje de un hombre hacia el futuro para salvar un mundo moribundo.', '2020-10-01', '/7D430eqZj8y3oVkLFfsWXGRcpEG.jpg', '878,53,18'),
(741074, '934.453', 'Érase una vez un muñeco de nieve', 'Los primeros días de vida del pequeño Olaf, cuándo y por qué cobra vida y cómo empieza a buscar su propia identidad, después de la huída de Elsa del palacio de Arendelle.', '2020-10-23', '/vjSLnDxEYhuh6AaEMMM7xGFnbBB.jpg', '16,10751,35,14'),
(497582, '894.494', 'Enola Holmes', 'Enola Holmes, una intrépida joven que busca a su madre, utiliza su brillante instinto investigador para superar a su hermano Sherlock y ayudar a un lord en su fuga.', '2020-09-23', '/riYInlsq2kf1AWoGm80JQW5dLKp.jpg', '80,18,9648');

